import "./ipro.css";
import 'font-awesome/css/font-awesome.min.css';

function Ipro_Edge() {
    return (
        <div>
            <div id="navi">
                <div id="hari">
                    <h3 >ipro</h3>
                    <h5 >EDGE</h5>
                </div>

                <br />
                <i id="email" style={{ color: "white" }} class="fa fa-envelope-o" aria-hidden="true"></i>
                <input id="hari2" type="Email" placeholder="___name@gmail.com" />
                <br /><br />
                <i id="user" style={{ color: "white" }} class="fa fa-user" aria-hidden="true"></i>
                <input id="hari3" style={{ color: "white" }} type="password" placeholder="___password" />

                <br /><br />
                <button id="hari4">LOGIN</button>

            </div>

        </div>
    )
}
export default Ipro_Edge;
